def classify(texts):
    url = "http://183.6.28.97:8190/taskflow/utc"

    headers = {"Content-Type": "application/json"}

    data = {"data": {"text": texts}}
    try:
        res = requests.post(url=url, headers=headers, data=json.dumps(data))
    except:
        logger.error("è¯·æ±‚åˆ†ç±»æŽ¥å£å¤±è´¥")
        return "", []
    else:
        r = res.json()['result']
    logger.info(r)
    if r[0]['predictions']:
        labels = sorted(r[0]['predictions'], key=lambda x: x['score'], reverse=True)
        if len(labels) > 1 and 'å…¶ä»–' == labels[0]['label']:
            r[0]['label'] = labels[1]['label']
        else:
            r[0]['label'] = labels[0]['label']
    else:
        r[0]['label'] = ""
    label = r[0]['label']
    predictions = r[0]['predictions']
    return label, predictions


def batch_classify(texts):
    url = "http://183.6.28.97:8190/taskflow/utc"

    headers = {"Content-Type": "application/json"}

    data = {"data": {"text": texts}}
    try:
        res = requests.post(url=url, headers=headers, data=json.dumps(data))
    except:
        logger.error("è¯·æ±‚åˆ†ç±»æŽ¥å£å¤±è´¥")
        return "", []
    else:
        r = res.json()['result']
    ls = []
    for item in r:
        dic = dict()
        dic['predictions'] = item['predictions']
        if item['predictions']:
            labels = sorted(item['predictions'], key=lambda x: x['score'], reverse=True)
            if len(labels) > 1 and 'å…¶ä»–' == labels[0]['label']:
                dic['label'] = labels[1]['label']
            else:
                dic['label'] = labels[0]['label']
        else:
            dic['label'] = ""
        ls.append(dic)
    return ls


